import * as React from "react";
import NavigationItem from "./NavigationItem";

const Navigation = () => {
    const navItems = [
        { label: "Dashboard", isActive: true },
        { label: "Stocks History", isActive: false },
        { label: "Predictions", isActive: false },
        { label: "Admin", isActive: false },
        { label: "", isActive: false },
        { label: "", isActive: false }
    ];

    return (
        <div className="flex overflow-hidden flex-wrap gap-6 items-center p-8 leading-none bg-white border-b border-zinc-300 font-[number:var(--sds-typography-body-font-weight-regular)] text-[color:var(--sds-color-text-default-default)] text-[length:var(--sds-typography-body-size-medium)] max-md:px-5">
            <div className="flex flex-wrap flex-1 shrink gap-2 items-start self-stretch my-auto basis-0 min-w-[240px] max-md:max-w-full">
                {navItems.map((item, index) => (
                    <NavigationItem
                        key={index}
                        label={item.label}
                        isActive={item.isActive}
                    />
                ))}
            </div>
            <div className="flex shrink-0 gap-3 self-stretch my-auto h-8 w-[178px]" />
        </div>
    );
};

export default Navigation;
